import React, { useState } from "react";
import LockOutlinedIcon from "@mui/icons-material/LockOutlined";
import { Button, TextField, Grid, Paper, Avatar } from "@mui/material";
import { useNavigate } from "react-router-dom";
import Usefetch from "./UseFetch";

function Login() {
  const [email, setemail] = useState("");
  const [password, setpassword] = useState("");
  const [data, setData] = useState([]);
  let navigate = useNavigate();
  const paperStyle = {
    padding: 20,
    height: "70vh",
    width: 350,
    margin: "20px auto",
  };
  const avatharStyle = { background: "green" };
  const passwordStyle = { marginTop: "8%" };
   function login() {

    const { data, loading, error } = Usefetch(
      `https://retoolapi.dev/B13laa/getusers?user_id=${email}&password=${password}`
    );
    // .then((res) => res.json())
    // .then((json) => {
    //   console.log("json",json);
    //   setData(json);
    // })
    // .catch((e) => {
    //   console.log("e", e);
    // });

    navigate("/profile");
    // history.push("/profile");
  }
  return (
    <Grid>
      <Paper elevation={10} style={paperStyle}>
        <Grid align="center">
          <Avatar style={avatharStyle}>
            <LockOutlinedIcon />
          </Avatar>
          <h2>sign In</h2>
          <TextField
            value={email}
            onChange={(e) => {
              setemail(e.target.value);
            }}
            label="Username"
            placeholder="Enter Username"
            fullWidth
          ></TextField>
          <TextField
            value={password}
            onChange={(e) => {
              setpassword(e.target.value);
            }}
            style={passwordStyle}
            label="Password"
            placeholder="Enter password"
            type={"password"}
            fullWidth
          ></TextField>
          <Button
            // component={Link}
            // to={"/profile"}
            onClick={login}
            type={"submit"}
            style={passwordStyle}
            color="primary"
            variant="contained"
            fullWidth
          >
            Login
          </Button>
        </Grid>
      </Paper>
    </Grid>
  );
}

export default Login;
